import React, { Component } from "react";
import StudentNavMenu from "./StudentNavMenu";
import { Accordion, Card } from "react-bootstrap";
import PersonalInformation from "./PersonalInformation";
import ImmediateNeeds from "./ImmediateNeeds";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { getInitialData } from "../../actions/commonActions";
import { getStudents } from "../../actions/studentActions";

class Student extends Component {
  componentDidUpdate() {
    this.props.getStudents();
  }

  render() {
    return (
      <div className="student-container">
        <StudentNavMenu></StudentNavMenu>

        <div className="student-form-container ml-auto">
          <Accordion
            activeKey={this.props.student.activeStudentSection}
            className="sfc-accordion"
          >
            <Card className="sfc-container">
              <Accordion.Collapse eventKey={0}>
                <PersonalInformation></PersonalInformation>
              </Accordion.Collapse>
            </Card>
            <Card className="sfc-container">
              <Accordion.Collapse eventKey={1}>
                <ImmediateNeeds></ImmediateNeeds>
              </Accordion.Collapse>
            </Card>
          </Accordion>
        </div>
      </div>
    );
  }
}

Student.propTypes = {
  student: PropTypes.object.isRequired,
  common: PropTypes.object.isRequired,
  getStudents: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  student: state.student,
  common: state.common,
});

export default connect(mapStateToProps, { getStudents })(Student);
